import React from "react";
import MetaTags from "react-meta-tags";

const WatchContent = () => {
  const videoslider = (links) => {
    document.querySelector(".slider").src = links;

    // const meta = {
    //   title: "Some Meta Title",
    //   description: "I am a description, and I can create multiple tags",
    //   canonical: "http://example.com/path/to/page",
    //   meta: {
    //     charset: "utf-8",
    //     name: {
    //       keywords: "react,meta,document,html,tags",
    //     },
    //   },
    // };
  };

  return (
    <div class="container">
      {/* <DocumentMeta {...meta} /> */}
      <video
        src="./vid-1.mp4"
        class="slider"
        autoplay
        loop
        muted
        controls
      ></video>

      <ul>
        <li onclick="videoslider('./vid-1.mp4')">
          <video src="./vid-1.mp4"></video>
        </li>
        <li onclick="videoslider('./vid-2.mp4')">
          <video src="./vid-2.mp4"></video>
        </li>
        <li onclick="videoslider('./vid-3 .mp4')">
          <video src="./vid-3.mp4"></video>
        </li>
        <li onclick="videoslider('./vid-4.mp4')">
          <video src="./vid-4.mp4"></video>
        </li>
        <li onclick="videoslider('./vid-5.mp4')">
          <video src="./vid-5.mp4"></video>
        </li>
      </ul>
    </div>
  );
};

export default WatchContent;
